import React from 'react';


function Header(props) {
    const {name} = props;
    return (
        <div className="nav-header">
        <div className="container">
            <ul className="nav">
                <li>{name}</li>
                <li>Sign Out</li>
            </ul>
        </div>
    </div>
    );
}

export default Header;
